import { useState } from "react";
import "../assets/FlipCard.css";
const FlipCard = () => {
  const [flipCard, setFlipCard] = useState(Array(8).fill(true));

  const images = [
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
    "data:image/jpeg;base64,",
  ];

  const handleFlipCard = (idx) => {
    const newFlippedState = [...flipCard];
    newFlippedState[idx] = !newFlippedState[idx];
    setFlipCard(newFlippedState);
  };

  return (
    <div className="flex flex-col items-center justify-center h-full w-full m-auto">
      <h2 className="text-3xl">Flip Card</h2>
      <section className="border-2 border-blue-900 w-[80%] mt-10 h-[500px] flex items-center justify-evenly gap-10">
        {images.map((elem, idx) => (
          <div key={idx} className="relative">
            <img
              src={elem}
              alt={idx}
              className={`card ${flipCard[idx] ? "flipped" : ""}`}
              onClick={() => handleFlipCard(idx)}
            />
          </div>
        ))}
      </section>
    </div>
  );
};

export default FlipCard;
